package isola.tags.js.browser;import javax.servlet.jsp.JspException;import isola.helpers.JsGenerator;import isola.tags.base.BaseTag;public class CloseWindowTag extends BaseTag {	private static final long serialVersionUID = 3159259911862537925L;		@Override	public int doEndTag() throws JspException {		try {			String str = JsGenerator.closeWindow();			pageContext.getOut().write(str);		} catch (Exception e) {			e.printStackTrace();		}		return EVAL_PAGE;	}		@Override	protected void clear() {	}}